import React from 'react'
import styled from './Square.module.css'

const Square = () => {
    const [value, setValue] = useState('')

    const handleValue = () => {
        setValue(!value)
    }

    return (
        <React.Fragment>
            <button className={styled.square} onClick={handleValue}>{value}</button>
        </React.Fragment>
    )
}

export default Square
